import React from 'react';

const Footer = () => {
    const footerStyle = {
        position: 'fixed', // Fija el footer en la parte inferior
       
        bottom: 0,
        width: '100%',
        backgroundColor: '#f8f9fa', // Ajusta el color de fondo según tus necesidades
        color: '#6c757d', // Ajusta el color del texto según tus necesidades
        textAlign: 'center',
        paddingTop: '50px', // Ajusta el padding según tus necesidades
        zIndex: 1000, // Asegura que el footer se mantenga sobre otros elementos
    };
    return (
        <footer style={footerStyle}>
            <div>
                <p>&copy; {new Date().getFullYear()} ICD. Todos los derechos reservados.</p>
                {/* Puedes agregar más contenido aquí, como enlaces o información adicional */}
            </div>
        </footer>
    );
};

export default Footer;
